import imageone from './img/pic10.png'
import imagetwo from './img/woodlawn2.png'
import imagethree from './img/woodlawntitle2.png'
import { Link, useNavigate } from 'react-router-dom'
import './cotcstyle.css';


function Store() {
 
	
	let navigate = useNavigate();
	
	const navstore = function () {
   
    navigate('/store');
  };
  return (
  <body className="site">
<div className="bgmood">
    <div className="div1"> <h1 className="bgtext">Children of the corn store</h1>
	<img src={imagetwo} className = "im1" /></div>




	</div>
	<div className="div1"> <p className="bgtext">Games</p> </div>
	
	
	<div className="div1" onClick={navstore}> <h1 className="bgtext">Contact</h1> </div>
	
	
	
	
	
	
	</body>
	
  );

}

export default Store;
